import cloud from '../images/cloud.png'

function Cloud (props) {


    return (
        <div className="cloud-container">
            <img src={cloud} alt="Cloud" className={props.class} />
            <div class="cloud-text">{props.text}</div>
        </div>
    );
}

export default Cloud;
